import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight, Github } from 'lucide-react';

const Features = () => {
  const features = [
    {
      title: "Dual Temporal Convolutional Layers",
      description: "Advanced TCN architecture with dual convolutional layers for efficient temporal feature extraction and pattern recognition in time series data.",
      benefits: ["High-speed processing", "Multi-scale feature extraction", "Temporal dependency capture"],
    },
    {
      title: "Transformer-Based Attention Mechanism",
      description: "State-of-the-art attention mechanisms that enable the model to focus on the most relevant temporal patterns and relationships.",
      benefits: ["Long-range dependency modeling", "Adaptive feature weighting", "Context-aware processing"],
    },
    {
      title: "Real-Time Anomaly Visualization",
      description: "Interactive dashboards and visualizations that provide real-time insights into detected anomalies and system behavior patterns.",
      benefits: ["Live monitoring", "Interactive exploration", "Customizable views"],
    },
    {
      title: "Model Interpretability & Diagnostics",
      description: "Comprehensive explainability features that help understand why anomalies were detected and provide actionable insights.",
      benefits: ["Feature importance analysis", "Anomaly explanation", "Diagnostic reports"],
    },
    {
      title: "Optimized Performance",
      description: "Lightweight architecture designed for efficiency across various hardware configurations, from edge devices to cloud infrastructure.",
      benefits: ["Low computational overhead", "Scalable deployment", "Resource optimization"],
    },
    {
      title: "Robust Anomaly Detection",
      description: "Advanced algorithms that can detect subtle anomalies while maintaining low false positive rates across diverse datasets.",
      benefits: ["High accuracy", "Low false positives", "Adaptable thresholds"],
    }
  ];

  return (
    <div className="min-h-screen pt-20 pb-10">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h1 className="text-4xl md:text-6xl font-bold text-secondary-900 dark:text-secondary-100 mb-6">
            Advanced Features
          </h1>
          <p className="text-xl text-secondary-600 dark:text-secondary-400 max-w-3xl mx-auto leading-relaxed">
            Explore the cutting-edge capabilities that make DTAAD a leading solution for multivariate time series anomaly detection
          </p>
        </motion.div>

        {/* Features Grid */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="grid md:grid-cols-2 lg:grid-cols-3 gap-8 mb-16"
        >
          {features.map((feature, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              whileHover={{ y: -5 }}
              className="glass p-8 rounded-2xl border border-secondary-200 dark:border-secondary-700 hover:shadow-lg transition-all duration-200 h-full"
            >
              <div className="w-16 h-16 bg-primary-600 rounded-xl flex items-center justify-center mb-6">
                <div className="w-8 h-8 bg-white rounded-lg" />
              </div>

              <h3 className="text-2xl font-bold text-secondary-900 dark:text-secondary-100 mb-4">
                {feature.title}
              </h3>

              <p className="text-secondary-600 dark:text-secondary-400 mb-6 leading-relaxed">
                {feature.description}
              </p>

              <div className="space-y-2">
                {feature.benefits.map((benefit, benefitIndex) => (
                  <div key={benefitIndex} className="flex items-center space-x-2">
                    <div className="w-2 h-2 bg-primary-600 rounded-full" />
                    <span className="text-sm text-secondary-700 dark:text-secondary-300">{benefit}</span>
                  </div>
                ))}
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* Technical Specifications */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="glass p-8 rounded-2xl border border-secondary-200 dark:border-secondary-700 mb-16"
        >
          <h2 className="text-3xl font-bold text-secondary-900 dark:text-secondary-100 mb-8 text-center">
            Technical Specifications
          </h2>

          <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-8">
            {[
              {
                label: "Processing Speed",
                value: "< 50ms",
                description: "Average inference time"
              },
              {
                label: "Accuracy",
                value: "97.2%",
                description: "Anomaly detection rate"
              },
              {
                label: "Parameters",
                value: "2.1M",
                description: "Lightweight architecture"
              },
              {
                label: "F1-Score",
                value: "0.94",
                description: "Balanced precision/recall"
              }
            ].map((spec, index) => (
              <div key={index} className="text-center">
                <div className="text-2xl font-bold text-primary-600 mb-1">{spec.value}</div>
                <div className="text-secondary-900 dark:text-secondary-100 font-semibold mb-1">{spec.label}</div>
                <div className="text-sm text-secondary-600 dark:text-secondary-400">{spec.description}</div>
              </div>
            ))}
          </div>
        </motion.div>

        {/* CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center"
        >
          <div className="glass p-12 rounded-2xl border border-secondary-200 dark:border-secondary-700">
            <h2 className="text-3xl font-bold text-secondary-900 dark:text-secondary-100 mb-4">
              Ready to Get Started?
            </h2>
            <p className="text-xl text-secondary-600 dark:text-secondary-400 mb-8 max-w-2xl mx-auto">
              Explore our comprehensive documentation or get hands-on experience with DTAAD's features
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <button className="px-8 py-4 bg-primary-600 hover:bg-primary-700 text-white rounded-lg font-semibold text-lg transition-colors duration-200">
                View Documentation
              </button>

              <a
                href="https://github.com"
                target="_blank"
                rel="noopener noreferrer"
                className="px-8 py-4 glass border border-primary-200 dark:border-primary-800 text-primary-700 dark:text-primary-300 rounded-lg font-semibold text-lg hover:bg-primary-50 dark:hover:bg-primary-900/20 transition-colors duration-200 flex items-center space-x-2 mx-auto"
              >
                <Github className="w-5 h-5" />
                <span>View Source</span>
              </a>
            </div>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default Features;
